def replace_and_count(text, search_str):
    count = 0
    def replace_match(match):
        nonlocal count
        replacement = str(count)
        count += 1
        return replacement

    import re
    pattern = re.compile(re.escape(search_str))
    replaced_text = pattern.sub(replace_match, text)
    return replaced_text

